let time = 0;
let numberTest = 0;
let status = 200; 

const tests = {
    time,
    numberTest,
    status
};

const checkStatus = () => {
    if (Test.status === 200) {
        return 'OK';
    } else {
        return 'WA';
    }
};

export { tests, checkStatus };
